if mibBuilder.loadTexts: hwDot3ahEfmEventConfigEntry.setDescription('Entries are automatically created and deleted from this table, and exist whenever the OAM entity supports Ethernet OAM events (as indicated by the eventSupport bit in hwDot3ahEfmFunctionsSuppported). Values in the table are maintained across changes to the value of hwDot3ahEfmOperStatus. Event configuration controls when the local management entity sends Event Notification OAMPDUs to its OAM peer, and when certain event flags are set or cleared in OAMPDUs. ')
